rovincial And Utility Tax incentives and rebates. These aren't the'$30 off' from your coffee maker rebates - they add up big time! For example, in Australia, if you spend $16,000 on a solar set up, they will rebate you up to $8000 back. This doesn't include other rebates you can get either. You'll need to check your own country's government policies - but, in the next 5-10 years - all countries will be jumping on the solar bandwagon.<\/p><h3>Not Just A 'One Time' Set Up + Easy Installation<\/h3><p>With solar, you don't need to invest into a bunch of costly arraysrightaway. You're able to set up one panel at a time, and add additional panels whenever you feel the time is right. Furthermore,installing a solar panel is actually quite a lot easier than peoplethink. You can do it yourself, or have an installer come and have itset up for you the same day.<\/p><\/div>",tZ='<gwt:clipper style="',SV='<html><body onload="if(parent.__gwt_onHistoryLoad)parent.__gwt_onHistoryLoad(__gwt_historyToken.innerText)"><div id="__gwt_historyToken">',AZ="<img onload='this.__gwtLastUnhandledEvent=\"load\";' src='",_T='=',sU='>',XY='?',TR='@',tY='A PotentialElement cannot be resolved twice.',vT='A request timeout has expired after ',qW='A32F02F1911204BA41E8517251689C5F',YR='ABQIAAAAG8LzhtshQCjpSshU_uJjmxTBfUk9TZrBRaIteybtnU2KziHEpRQvhPNTjo7DMczjrRD3yBPRJ_BSQQ',XR='ABQIAAAAG8LzhtshQCjpSshU_uJjmxTwM0brOpm-All5BF6PoaKBxRWWERTZER2lJ4GnsG8nvhKLOQ20degaEQ',g0='AGL',UZ='AREA',u5='AbsolutePanel',$3='AbstractCollection',R6='AbstractDataTable$ColumnType',T6='AbstractDataTable$ColumnType;',C7='AbstractHashMap',D7='AbstractHashMap$EntrySet',E7='AbstractHashMap$EntrySetIterator',G7='AbstractHashMap$MapEntryNull',H7='AbstractHashMap$MapEntryString',g6='AbstractList',I7='AbstractList$IteratorImpl',J7='AbstractList$ListIteratorImpl',X3='AbstractMap',K7='AbstractMap$1',L7='AbstractMap$1$1',F7='AbstractMapEntry',q4='AbstractRenderer',T4='AbstractSerializationStream',U4='AbstractSerializationStreamReader',V4=
